package com.simpsonwil.uaccounts.bukkit.players;

import com.simpsonwil.uaccounts.bukkit.exceptions.PlayerNotOnlineException;
import org.bukkit.Bukkit;
import org.bukkit.entity.Player;

import java.util.UUID;

/**
 * Created by Wil on 1/16/2015.
 */
public class UOfflinePlayer
{
    private UUID uuid;

    /**
     * Create a new instance for an OfflinePlayer given their uuid as a string
     *
     * @param uuid string uuid of a player
     */
    public UOfflinePlayer(String uuid)
    {
        this.uuid = UUID.fromString(uuid);
    }

    /**
     * Create a new instance of an OfflinePlayer given their uuid
     *
     * @param uuid uuid of the player
     */
    public UOfflinePlayer(UUID uuid)
    {
        this.uuid = uuid;
    }

    /**
     * Get the UUID of the UOfflinePlayer
     *
     * @return uuid of the UOfflinePlayer
     */
    public UUID getUUID()
    {
        return uuid;
    }

    public Player getPlayer() throws  PlayerNotOnlineException
    {
        for(Player p : Bukkit.getOnlinePlayers())
        {
            if(p.getUniqueId().equals(uuid))
                return p;
        }

        throw new PlayerNotOnlineException("Player with uuid \""+uuid.toString()+"\" not online or is corrupted.");
    }
}

